const Users = ({ users }) => {
  return (
    <ul className='list-group'>
      {users.map((user) => {
        return (
          <li className='list-group-item' key={user.id}>
            <h5>{user.name}</h5>
          </li>
        );
      })}
    </ul>
  );
};

export default Users;
